      "text": "1. Bey wome extra schöne frische Damascerne Meertrauben ohne Kammen in billigem Preis und beliebiger Quantität zu haben, ist im Berichtshaus ohne Entgeld zu vernehmen. 2. Ein Kuchin-Kästlein; Item ein Schleif- Stein mit einem Stock in billigem Preis, im Berichtshaus zu erfragen. 3. Bey Jungfr. Weyerin an der Huthgass sind frisch angelangte süße Pictings in billigem Preis zu haben. 4. Im Gasthof zur Blumen ist guter alter Sonig der Maas à 12 Bayen. Item Eindr à 12 Bg. der Centner. Ferner schöne gelbe Beyden in billigem Preis zu haben. 5. Bey wome schöne gelbe, weiße und schäckigte Canarien-Vögelchen Männl. und Weibl. in billigem Preis zu haben, ist im Berichtshaus zu vernehmen. 6. Nicht Saum guter rother alter Landwein à 10 Pfund der Saum. Sollte er aber zugleich mit einander genommen werden à 9 Pfund, weil man das Stücklein gern auf einmal lären möchte; Er wäre tauglich für einen Wirth in der Stadt oder auf der Landschaft, wovon Muster zu haben bey Hrn. Franz Lucas Lin- der dem Käser in der kleinen Stadt, leydet aber nicht lang Verzug. 7. Bey Frau Steinbrunn in klein Basel sind ungefähr 3 Saum rother Orensacher-Wein von 1753, davon man Ohrenweis haben fan; solte er aber mit einander genommen werden, so wurde man mehr billigen Preis machen. 8. Ein Stock schönes feinbriges unberregtes Emdt gleich vom dem Kiechemer-Thor, und ist sich darum bey Hrn. Appellations-Rath Nohiner auf dem Adelberg anzumelden."
    },
