      "date": "1762-04-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "9. Eine Bühsel-ſthr mit einer Feder und schönen Gebäus, die 8 Tag geht und Viertel repetirck in billigem Preis, im Berichtshaus zu erfragen. 10. Zehen Saum weißer Margrafer Wüler-Wein von 1753. in billigem Preis, im Berichtshaus zu erfragen. 11. Eine schöne nusbaumerne Bethladen für 2. Verionen, mit Schrauben. Item eine Caffa von dickem eichenen Holz, Schwarz angestrichen mit einem extra guten Schloß und Schleifen zu einem Maasſchlag mit eisen Spangen wohl beschlagen, am Deckel innwendig mit Haacken, auf einem grünen Fisch, à 6 Pfund. Ein Gewicht-Bräter samt 2 Spissen, Seil, Schrauben, Stein und Zugebörde: Item eine große kupferne Caffederolle fast neu, dito eine tiefe Kuchlein-Branne; Zwo noch fast neue Rollen, wohi mit starkem Eisen, alles in billigem Preis, im Berichtshaus ohne Entgeld zu erfragen. 12. Bey Meister Daniel Hßifer im Doctor-Garten sind schöne Kammelien, Wurgen und auch Gold-Stillen oder Narcissus indicus Jacobeus in billigem Preis zu haben. 13. Ein modernfarbes tuchenes Kleid in billigem Preis, im Berichtshaus zu erfragen. 14. Bey schönem Wetter eingesammeltes Heu und dito Emdt vom vorigen Jahr, in billigem Preis, im Berichtshaus zu erfragen. 15. Wo folgende Bücher zu erfragen: Münsters Cosmographie, Brandes allgemeine Chronica, Hedonis Kirchenhistorie, Josephi Jüdische Geschichte, Sleidani Historie, alle wohl gebunden, im Berichtshaus zu erfragen."
